import React from 'react'
import data from "./data"

export const Products = () => {
  return (
    <div>
        {
            data.map((product)=>{
                return(
                    <div>
                        <div>
                            <img src={product.thumbnail} alt="product" />
                        </div>
                        <div>
                            <p>{product.title}</p>
                            <p>{product.price}</p>
                        </div>
                    </div>
                )
            })
        }
    </div>
  )
}
